goog.provide("goog.storage.mechanism.mechanismfactoryTest");goog.setTestOnly("goog.storage.mechanism.mechanismfactoryTest");goog.require("goog.storage.mechanism.mechanismfactory");goog.require("goog.testing.jsunit");function setUp(){mechanism=goog.storage.mechanism.mechanismfactory.create("test");mechanism_shared=goog.storage.mechanism.mechanismfactory.create("test");mechanism_separate=goog.storage.mechanism.mechanismfactory.create("test2")}function tearDown(){if(!!mechanism){mechanism.clear();mechanism=null}if(!!mechanism_shared){mechanism_shared.clear();mechanism_shared=null}if(!!mechanism_separate){mechanism_separate.clear();mechanism_separate=null}}function testAvailability(){var probe=goog.storage.mechanism.mechanismfactory.create();if(!!probe){assertNotNull(mechanism);assertNotNull(mechanism_shared);assertNotNull(mechanism_separate)}}